    [],nt"revision_timestamp": "2016-10-15T16:36:28.608952",nt"name": "petit-manan-national-wildlife-refuge-annual-narrative-report-calendar-year-1986",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Petit
    Manan National Wildlife Refuge outlines Refuge accomplishments during the 1986 calendar
    year. The report begins with a summary of the year's highlights and weather conditions.
    Land acquisition is discussed. The report includes a planning section which discusses
    management planning and research and investigations. Refuge administration is outlined;
    information about personnel, youth programs, volunteer programs, funding, and technical
    assistance is given. Habitat management is also covered; subjects include wetlands,
    forests, grasslands, grazing, and fire management. The wildlife section of the report
    discusses wildlife diversity, endangered and threatened species, migratory birds,
    game mammals, marine mammals, fisheries resources, and disease prevention and control.
    The public uses of the Refuge described in this report include outdoor classrooms,
    interpretive programs, recreational uses, and law enforcement. The equipment and
    facilities section of the report provides information about rehabilitation and equipment
    utilization and replacement. Items of interest are provided at the end. Narrative
    reports for Cross Island, Seal Island, and Franklin Island National Wildlife Refuges
    is included. Photographs and brochures are attached.",nt"license_title": "License
